tables.table_schema:
CREATE TABLE chat_transcripts (
  id INT PRIMARY KEY,
  user_id INT,
  chat_timestamp TIMESTAMP,
  message TEXT
);

CREATE TABLE video_call_logs (
  id INT PRIMARY KEY,
  user_id INT,
  call_timestamp TIMESTAMP,
  duration INT
);

CREATE TABLE ChatTranscripts (
  chat_id UUID PRIMARY KEY,
  user_id UUID NOT NULL,
  chat_datetime TIMESTAMP NOT NULL,
  chat_message TEXT NOT NULL
);

CREATE TABLE chat_transcripts (
    chat_id UUID PRIMARY KEY,
    user_id UUID,
    chat_text TEXT,
    timestamp TIMESTAMP
);

CREATE TABLE user_profile (
    user_id UUID PRIMARY KEY,
    username VARCHAR(50),
    email VARCHAR(100),
    profile_image BYTEA
);

CREATE TABLE users (
    user_id UUID PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    email VARCHAR(100) NOT NULL,
    join_date TIMESTAMP NOT NULL
);

CREATE TABLE consultants (
    consultant_id UUID PRIMARY KEY,
    consultant_name VARCHAR(50) NOT NULL,
    expertise_area VARCHAR(100) NOT NULL,
    hire_date TIMESTAMP NOT NULL
);
